                </div>

                <div className="row row-cols-1 pt-5 mb-3 text-center">
                    <div className="col">
                        <div className="card mb-4 rounded-3 shadow-sm">
                            <div className="card-header py-3">
                                <h4 className="my-0">BASIC</h4>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
    );
};

